package ar.edu.itba.geb.compiler.java.syntaxtree;import ar.edu.itba.geb.compiler.java.visitors.TypeVisitor;import ar.edu.itba.geb.compiler.java.visitors.Visitor;public class IdentifierType implements Type {	public IdentifierType(String className) {		this.className = className;	}	public String className;	public void accept(Visitor v) {		v.visit(this);	}	public Type accept(TypeVisitor v) {		return v.visit(this);	}	@Override	public String toString() {		return className;	}}